function randomPlanets () {
	var w, h;
	var order = new Array(15);
	var notPassed = true;
	var displazamentDirection = ((Math.random() > 0.5) ? 1 : -1);
	var angle = Math.random() * (Math.PI/5);
	var anterior;

	while(notPassed){ //console.log("generating planets");
		notPassed = false;
		for (var i = order.length - 1; i >= 0; i--) {
			order[i] = i;
		};

		order = Utils.suffle(order);
		anterior = 20000;
		for (var i = 0; i < 15; i++) {
			anterior = w = anterior + (Math.random() / 5 + 1) * 7500;
			if (i == 5 || i == 10) w = anterior = w + 15000;
			w = i * 5500 + 15000;
			h = w * (1 - Math.random() * 1);
			//h = w * 1;

			planetsInCumulusData.nodes[i] = {
				w: w, //Orbit Width
				h: h, //Orbit Height
				d: displazamentDirection * Math.sqrt( w*w/4 - h*h/4 ),	//Obrit displacement
				r: 0,//Math.random() / 10,//Obrit rotation (in radians)
				ro: 0, //Planet rotation
				s: 4000, //Planet size
				i: 0, //Planet type (image)
				v: 25, //(predefinido: 5)Momento angular (para simplificar, velocidad). Para sacar la velocidad se aplica esta ecuacin: Velocidad angular = (momento_angular_planeta) / ( masa_sol * (distancia_sol_planeta ^ 2) )
				ip: Math.PI * 2 / 15 * order[i], //Planet initial position
				id: 0, //Planet ID
				nm: "Usuario: "+((100*Math.random()).toFixed(2)),
			};
		}

		//Comprobamos que sea un sistema vlido.
		var pos1, pos2, dist;
		for (var i = planetsInCumulusData.nodes.length - 1; i >= 0; i--) {
			pos1 = Utils.getPointEllipsePolarAngle(
				planetsInCumulusData.nodes[i].ip,
				planetsInCumulusData.nodes[i].w/2,
				planetsInCumulusData.nodes[i].h/2,
				-planetsInCumulusData.nodes[i].d * Math.cos(planetsInCumulusData.nodes[i].r),
				planetsInCumulusData.nodes[i].d * Math.sin(planetsInCumulusData.nodes[i].r),
				planetsInCumulusData.nodes[i].r
			);
			for (var j = planetsInCumulusData.nodes.length - 1; j >= 0; j--) {
				if (i!=j) {
					pos2 = Utils.getPointEllipsePolarAngle(
						planetsInCumulusData.nodes[j].ip,
						planetsInCumulusData.nodes[j].w/2,
						planetsInCumulusData.nodes[j].h/2,
						-planetsInCumulusData.nodes[j].d * Math.cos(planetsInCumulusData.nodes[j].r),
						planetsInCumulusData.nodes[j].d * Math.sin(planetsInCumulusData.nodes[j].r),
						planetsInCumulusData.nodes[j].r
					);

					dist = Math.sqrt( (pos1[0] - pos2[0])*(pos1[0] - pos2[0]) + (pos1[1] - pos2[1])*(pos1[1] - pos2[1]) );
					//console.log(dist);
					if (dist < planetsInCumulusData.nodes[0].s * 2.2){
						notPassed = true;
						break;
					}
				}
			}
			if (notPassed) break;
		}
	}
}

